script: |
  super -f text -I q3835.spq | sort > q3835.out

inputs:
  - name: q3835.spq
    data: |
      SELECT ( + 86 ) / col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( + - ( - 9 ) * + + 83 + 13 );
  - name: tab1

outputs:
  - name: q3835.out
    data: |
      0
      1
      1
